// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./NFT.sol";

contract MyCollectible is NFT {
  struct Collectible {
    address owner;
    string URI;
    uint256 price;
  }

  uint256 tokenCounter = 1;

  mapping(uint256 => Collectible) public collectibles;

  constructor() {
  }

  function mint(string memory tokenURI) public returns (uint256) {
    uint256 tokenId = tokenCounter++;
    _mint(msg.sender, tokenId);
    collectibles[tokenId] = Collectible(msg.sender, tokenURI, 0);
    return tokenId;
  }

  function getPrice(uint256 tokenId) public view returns (uint256) {
    return collectibles[tokenId].price;
  }

  function setPrice(uint256 tokenId, uint price) public {
    require(msg.sender == collectibles[tokenId].owner, "You do not own this NFT");
    require(price != 0, "Price cannot be zero");
    collectibles[tokenId].price = price;
  }

  function getCount() public view returns (uint256) {
    return tokenCounter - 1;
  }
}
